import React, { useEffect, useState } from "react";
import { Card } from "react-bootstrap";
import axios from "axios";

const ObjectCard = ({ identifier }) => {
  const [registryNumber, setRegistryNumber] = useState("");
  const [objectName, setObjectName] = useState("");

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.post(`http://localhost:5009/api/getObjCards/${identifier}`);
        const { registry_number, name } = response.data;
        setRegistryNumber(registry_number);
        setObjectName(name);
      } catch (error) {
        console.log("Ошибка при получении информации об объекте:", error);
      }
    };

    fetchData();
  }, [identifier]);

  return (
    <Card border="secondary" style={{ margin: 10 }}>
      <Card.Body>
        <Card.Title>Информация об объекте с идентификатором {identifier}</Card.Title>
        <Card.Text>
          <strong>Реестровый номер:</strong> {registryNumber} <br />
          <strong>Наименование:</strong> {objectName} <br />
        </Card.Text>
      </Card.Body>
    </Card>
  );
};

export default ObjectCard;
